import './App.css';
import React from "react"
import StudentCreate from "./component/student/StudentCreate";
import {ToastContainer} from "react-toastify";
import 'react-toastify/dist/ReactToastify.css';
import {BrowserRouter, NavLink, Route, Routes} from "react-router-dom";
import StudentListFunction from "./component/student/StudentListFunction";


function App() {
    return (
        <>
            <BrowserRouter>
                <nav className="navbar navbar-expand-lg navbar-light bg-light p-3">
                    <div className="container">
                        <NavLink to="/student" className="navbar-brand">Danh sách</NavLink>
                        <NavLink to="/create" className="navbar-brand">Thêm mới</NavLink>
                    </div>
                </nav>
                <div className="container mt-4">
                    <Routes>
                        <Route path="/create" element={<StudentCreate />} />
                        <Route path="/student" element={<StudentListFunction />} />
                    </Routes>
                </div>
            </BrowserRouter>
            <ToastContainer />
        </>

    );
}

export default App;
